import React, { useState, useEffect } from "react";
import Axios from "axios";
const App = () => {
  const [movie, setMovie] = useState([]);
  const api =
    "https://api.themoviedb.org/3/search/movie?api_key=fac34116c639f3e75cd5205251be421c&query=search";
  console.log(movie);
  useEffect(() => {
    Axios.get(api).then(json => console.log(json));
  }, [api]);

  return <li>{}</li>;
};

export default App;
